import React from 'react';

import './Grid.css';

const Grid = (props) => {


    let style = '';

    if (props.landing) {
        style = {
            'display': 'flex'
        }
    }



  return <div className="grid" style={{
    style
  }}>{props.children}</div>;
};

export default Grid;
